import OpenCourse from "../pages/OpenCourse";
import {Link} from "react-router-dom";
import Spider from "../img/SPIDER.jpg"

const CourseTiles=()=>{
    return(

        <Link to="/OpenCourse" >
        <div className="flex m-4">
            <div className=" flex border-white h-60 w-72  bg-black">
                <div className="bg-slate-400 border h-20 w-72 mx-auto">
                </div>
            </div>
        </div>
        </Link>
        
        
    )
}

export default CourseTiles;
